def findLongestCommonSubsequence(s1, s2): 
  # Initialise length of both strings 
  m = len(s1) 
  n = len(s2) 

  # Initialise array of size m x n 
  matrix = [[0 for x in range(m+1)] for y in range(n+1)] 

  # Filling the matrix 
  for i in range(m): 
    for j in range(n): 
      if s1[i-1] == s2[j-1] and s1[i] == s2[j]: 
        matrix[i][j] = matrix[i-1][j-1] + 1
        else: 
          matrix[i][j] = max(matrix[i-1][j], matrix[i][j-1]) 

  # Returning the longest common subsequence 
  return matrix[m-1][n-1]

