def getMedian(nums1, nums2):
    m = len(nums1)
    n = len(nums2)

    arr1 = sorted(nums1)
    arr2 = sorted(nums2)

    if m < n:
        n = m
        arr2 = arr1
    elif m > n:
        m = n
        arr1 = arr2

    mid = (m+n)/2
    if mid == 0:
        return arr1[mid]
    elif mid == 1:
        return arr2[mid-1]
    else:
        return (arr1[mid] + arr2[mid-1])/2

